    true,nt"url": null,nt"notes": "The data sets in this directory were provided
    by Mr. Gregory Yetman and Drs. Stuart Gaffin and Deborah Balk from the Center for
    International Earth Science Information Network (CIESIN) at Columbia University.
    There are three data files at three spatial resolutions of 0.25, 0.5 and 1.0 degree
    in both latitude and longitude and for the reference year of 1990.Estimates of Gross
    Domestic Product (GDP) are commonly given for nations as a single aggregated number.
    This data set generates estimates of GDP density distributed subnationally to facilitate
    the integration of GDP with other data at a sub-national level and to promote interdisciplinary
    studies that include socioeconomic aspects.  This is one of two coarse resolution
    Socioeconomic data sets included in the International Satellite Land Surface Climatology
    Project (ISLSCP) Initiative II data collection, the other being the Gridded Population
    of the World (GPW), also produced by CIESIN. ",nt"license_title": "U.S. Government
